if mibBuilder.loadTexts: switchIfCounterDiscontinuityTime.setDescription("The value of sysUpTime on the most recent occasion at which any one or more of this interface's counters suffered a discontinuity. The relevant counters are the specific instances associated with this interface of any Counter32 or Counter64 object contained in the switchIfTable or switchIfXTable. If no such discontinuities have occurred since the last re- initialization of the local management subsystem, then this object contains a zero value.")
switchEtherStatsTable = MibTable((1, 3, 6, 1, 4, 1, 343, 2, 19, 1, 2, 10, 203, 5), )
if mibBuilder.loadTexts: switchEtherStatsTable.setStatus('current')
if mibBuilder.loadTexts: switchEtherStatsTable.setDescription("This table is taken directly from the RMON-MIB. However, it has been slightly modified by adding an extra indice (by switch)[[ and adding a prefix so as not to conflict with the pre-existing namespace]]. We want to be able to capture the data from all switches within the chassis, thus can't easily incorporate within the main table as data differs by switch and by the chassis, itself. Thus, the main group reflects the chassis, and this table reflects the switches. Otherwise it is identical. The Ethernet Statistics Group Implementation of the Ethernet Statistics group is optional. Consult the MODULE-COMPLIANCE macro for the authoritative conformance information for this MIB. The ethernet statistics group contains statistics measured by the probe for each monitored interface on this device. These statistics take the form of free running counters that start from zero when a valid entry is created. This group currently has statistics defined only for Ethernet interfaces. Each switchEtherStatsEntry contains statistics for one Ethernet interface. The probe must create one switchEtherStats entry for each monitored Ethernet interface on the device.")
